    public static class Day3Fabric
    {
        //has a width
        //has a height
        //has a list of things
        //has a default problem
        //has a parser

        static private int width = 0;
        static private int height = 0;
        static List<Day3Claim> claims = new List<Day3Claim>();
        static int[,] fabric;

        public static void reset()
        {
            claims = new List<Day3Claim>();
            createFabric(0, 0);
            width = 0;
            height = 0;
        }
        public static Day3Coord getCalculatedDims()
        {
            return new Day3Coord(width, height);

        }

        public static void createFabric(int width, int height)
        {
            fabric = new int[width, height];
        }

        public static void parse(string problem)
        {
            var words = problem.Split("\r\n");
            foreach (string word in words)
            {
                Day3Claim newclaim = new Day3Claim(word);
                width = Math.Max(width, newclaim.w + newclaim.x);
                height = Math.Max(height, newclaim.h + newclaim.y);
                claims.Add(newclaim);
            }

        }
        public static void claimAll()
        {
            foreach (Day3Claim claim in claims)
            {
                claimSection(claim);
            }

        }
        public static string getSolution()
        {
            string output = "";
            int countclaimedspace = 0;
            int countdoubleclaimedspace = 0;
            int width = fabric.GetLength(0);
            int height = fabric.GetLength(1);
            double progress = 0;
            for (int y = 0;  y < height; y++)
            { 
                for (int x= 0; x < width; x++)
                {
                    
                    if (fabric[x, y] > 0)
                    {
                        countclaimedspace++;
                        if (fabric[x, y] > 1)
                            countdoubleclaimedspace++;
                    }

                    //output += fabric[x, y].ToString();
                }
                //output += "\r\n";

                progress = (( Convert.ToDouble(y)/ Convert.ToDouble(height)) * 100);
                progress = Math.Round(progress, 2);
                Console.WriteLine("Progress: " + progress+ "%");
            }
            output = "Total claimed squares = [" + countclaimedspace + "], double+ claimed squares = [" + countdoubleclaimedspace + "]\r\n" + output;
            return output;

        }
        public static void claimSection(Day3Claim newclaim )
        {
            for (int y = newclaim.y; y < newclaim.y + newclaim.h; y++)
                for (int x = newclaim.x; x < newclaim.x + newclaim.w; x++)
                {
                    fabric[x, y]++;

                }


        }
        public static void writeFabric (string filename)
        {
            using (System.IO.StreamWriter file = new System.IO.StreamWriter(@"Day3Output.csv"))
            {
                string line = "";
                for (int y = 0; y < height; y++)
                {
                    for (int x = 0; x < width; x++)
                    {

                        line += fabric[x, y] + ",";
                    }
                    file.WriteLine (line);
                    line = "";

                }

                file.Close();
            }
        }


    }
